    try {
        const tdamages = await T_damage.findAll({
            attributes: ['td_id', 'td_type', 'td_figure', 'td_description', 'td_color'],
            where: {
                td_id: id
            }
        });
        if (tdamages.length > 0) {
            tdamages.forEach(async tdamage => {
