                    td_type, td_figure, td_description, td_color
                });
            })
        }
        return res.json({
            message: 'Tipo de daño editado sastifactoriamente',
            data: tdamages
        })
    } catch (error) {
        console.log(error)
        res.status(500).json({
            message: 'No se editó el tipo de daño',
        });
    }
};

